INSERT INTO `system_settings` (`setting_key`, `setting_value`) VALUES
('default_warranty_terms', '1. වගකීම් කාලය (Warranty Period) අදාළ භාණ්ඩ සඳහා ඉන්වොයිසියේ සඳහන් දින සිට වලංගු වේ.\r\n2. වගකීම් සේවාව ලබාගැනීම සඳහා මෙම ඉන්වොයිස්පත (Original Invoice) ඉදිරිපත් කිරීම අනිවාර්ය වේ.\r\n3. භෞතික හානි (Physical Damages), දියර හානි (Liquid Damages), විදුලි දෝෂ (Power Issues), සහ අකුණු ගැසීම් (Lightning) සඳහා වගකීම් සේවාව අදාළ නොවේ.\r\n4. මෘදුකාංග (Software) සහ මෙහෙයුම් පද්ධති (OS) සඳහා වගකීම් සේවාව හිමි නොවේ.\r\n5. කිසිඳු හේතුවක් මත මුදල් ආපසු ගෙවීමක් (Refund) සිදු නොකරනු ලැබේ.\r\n6. වගකීම් කාලය තුළ අලුත්වැඩියා කරනු ලබන භාණ්ඩ නැවත භාරදීමේදී සිදුවන ප්‍රමාද දෝෂ සඳහා ආයතනය වගකියනු නොලැබේ.'),
('invoice_footer_credit', '© software developed by : KAWDU TECHNOLOGY - 0776 228 943 | 0786 228 943'),
('show_footer_credit', '1'),
('show_warranty_on_invoice', '1');
